import React from 'react';
import logo  from "../logo.png";
import '../style/navbar.css';

export default function Navbar() {
  return (
    <nav>
        <ul className='top'>
          <li><img src={logo} /></li>
          <li>
            <span className='spam'></span>
          </li>
        </ul>
        <ul className='bottom'>
          <li><h3>Home</h3></li>
          <li><h3>About</h3></li>
          <li><h3>Contact</h3></li>
        </ul>
      <ul className="social-media"></ul>
    </nav>
  );
}
